import { StatusBar } from 'expo-status-bar';
import React, { useEffect, useState } from 'react';
import { Text, View, Button, AppRegistry } from 'react-native';
// import * as Location from 'expo-location';

import auth from './auth';


import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LandingPage from './Components/LandingPage';
import Register from './Components/Register';
import Login from './Components/Login';
// import Feed from './Components/Feed';
import Dashboard from './Components/Dashboard';
import Post from './Components/Post';

const Stack = createStackNavigator();

const App = () => {

  const initialState = auth.isAuthenticated();
  const [isAuthenticated, setIsAuthenticated] = useState(initialState);


  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName='Landing'>
        <Stack.Screen name='Landing' component={LandingPage} options={{ headerShown: false }} />
        <Stack.Screen name='Register' component={Register} setIsAuthenticated={setIsAuthenticated} options={{ headerShown: false }} />
        <Stack.Screen name='Login' component={Login} setIsAuthenticated={setIsAuthenticated} options={{ headerShown: false }} />
        {/* <Stack.Screen name='Main' component={Main} /> */}
        {/* <Stack.Screen name='Feed' component={Feed} /> */}
        {/* <Stack.Screen name='Dashboard' component={Dashboard}  /> */}
        <Stack.Screen name='Dashboard' component={Dashboard} />
        <Stack.Screen name='Post' component={Post} options={{ headerShown: false }} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
